H20年11月にフルモデルチェンジされたキューブのオーディオレス車など、日産ワイドサイズ窓口付車（20Pコネクター仕様）対象の取付キットです。電源コネクターは20P。アンテナ変換コネクターほか、オプション用コネクターも同梱し、3信号（車速・バック・パーキング）の取出しも可能。横幅の広い日産ワイドサイズ窓口の車に、１Ｄ＋１Ｄ～２ＤＩＮサイズのオーディオ、ナビゲーションなどの取付が可能です。 <br><br>■構成部品 .■パネル(ワイドサイズ用、黒、2個)　■コネクター(20P)　■アンテナ変換コネクター　■オプション用コネクター(12P)　■スポンジテープ　■M5x8ねじ(4本)　■φ5x10ねじ(4本)　■ほかに取付説明書を同梱<br><br>※メーカーオプションの「カーウイングスナビゲーションシステム」付車は、車両ハーネスの仕様が異なるため、オプション用コネクター(12P)が使用できません。 <br><br>日産ワイドサイズ窓口付車（20Pコネクター仕様） <br><br>　車検対応品<br><br>カーオーディオ、ビジュアル/配線・取付金具<tr><td colspan="2">
