＜14mm前出し取付対応※＞H17年9月以降の「フォルクスワーゲン ポロ」専用取付キットです。純正2Dオーディオ付車に市販品をトレードイン取付できます。電源コネクターは、古くから使われているISO(16P)ではなく、新しいFAKRA(16P)コネクター仕様のセットとなっています。 <br><br>■構成部品 ■パネル（標準取付用） ■パネル（14mm前出し取付用） ■取付ケース ■サイドブラケット（2枚） ■リアブラケット ■カーラジオ取外し工具（4本） ■アンテナ変換アダプター（FAKRA入力、JASO出力） ■電源コネクター（FAKRA 16P） ■アクセサリー電源取出しコード ■イルミネーション電源取出しコード ■エレクトロタップx2 ■ブッシュ ■ブッシュ固定用ねじx1 ■ブラケット固定用ねじx4<br><br>※取付ける製品の奥行きがあり車両部品に干渉してしまう場合や、配線類が多く取付けが困難な場合などに、製品を通常より14mm前に出して取り付ける事がが可能です。パネルを2枚同梱し、標準位置取付け・14mm前出し取付けの選択が可能です。 <br><br>VW ポロ(9N2) <br><br>　車検対応品<br><br>カーオーディオ、ビジュアル/配線・取付金具<tr><td colspan="2">
