H18年10月にフルモデルチェンジされたムーヴ／ムーヴカスタム(L175S/L185S)のインテグレートオーディオ（異形ラジオ）付車用取付キットです。標準装備の異形ラジオを外して、トレードイン取付ができます。オプションコネクターから車速信号・バック信号なども取出しが可能で、１Ｄ＋１Ｄ～２ＤＩＮサイズのオーディオ、ナビゲーションなどの本体取付が可能です。 <br><br>■構成部品 ■専用パネル（黒） ■ブラケット（Ｌ） ■ブラケット（Ｒ） ■コネクター(10P) ■コネクター(6P) ■コネクター(5P) ■アンテナ電源変換コード ■バインドねじx4 ■トラスタッピングねじx4 ■ほかに取付説明書を同梱<br><br>※オーディオレス車（200mm幅窓口）には取付けできません。※インダッシュテレビはモニター立上げ時に車両メーターの視認性確保ができないため取付けできません。 <br><br>L175S/L185S ムーヴ／ムーヴカスタム <br><br>　車検対応品<br><br>カーオーディオ、ビジュアル/配線・取付金具<tr><td colspan="2">
