H17年4月に新しく発売になったエアウェイブのオーディオレス車対象の取付キットです。２ＤＩＮサイズのオーディオはもちろん、ナビゲーションの取付も可能です。 弊社従来の専用パネルを改良し、パイオニア株式会社商品：新型RAKU-NAVI（AVIC-HRZシリーズ）のフェイスオープンにも対応しています。 <br><br>■構成部品 ■専用パネル ■スポンジテープ ■サイドブラケット（Ｌ） ■サイドブラケット（Ｒ） ■コネクター ■アンテナ変換コネクター ■バインドねじx8 ■トラスタッピングねじx8 ■ほかに取付説明書を同梱<br><br>エアウェイブにて開発をいたしましたが、オーディオレス仕様が多くなってきた最近のホンダ車で、本キットが使用できる車種が増えてきています。新型車の適合などは弊社までお問い合わせください。 <br><br>エアウェイブ(H17/4～) <br><br>　車検対応品<br><br>カーオーディオ、ビジュアル/配線・取付金具<tr><td colspan="2">
